import React from 'react';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

const PM25Chart = ({ data, title = 'PM2.5 Trends' }) => {
    const chartData = {
        labels: data.map(d => d.x),
        datasets: [{
            label: 'PM2.5 Levels',
            data: data,
            borderColor: 'rgb(75, 192, 192)',
            tension: 0.1
        }]
    };

    const options = {
        responsive: true,
        plugins: {
            title: {
                display: true,
                text: title
            }
        },
        scales: {
            x: {
                type: 'time',
                time: {
                    unit: 'day'
                }
            },
            y: {
                title: {
                    display: true,
                    text: 'PM2.5 (μg/m³)'
                }
            }
        }
    };

    return (
        <div className="chart-container">
            <Line data={chartData} options={options} />
        </div>
    );
};

export default PM25Chart;
